import React, { useEffect, useState } from 'react';
import axios from 'axios'
import { BrowserRouter, Routes ,Route, Link, useLocation } from 'react-router-dom';

interface UserProps {
  userData: any;
}

const UserPage = (props: UserProps) => {
    const [loggedIn, setLoggedIn] = useState<string | null>(localStorage.getItem('loggedIn'));
    const [localUserData, setUserData] = useState<any>(props.userData);
    console.log(localUserData)
    return <>
      <div className=' relative p-10 pl-20 w-full h-fit bg-light-green'>
        <h1 className='font-UI text-5xl'>Dashboard</h1>
      </div>
      <div className='flex flex-col w-1/3'>
        <div className='flex m-10 w-full p-10'>
          <h1 className='font-UI text-3xl mr-20'>Your Info:</h1>
          <div className='grid-cols-1 space-y-4 mt-10'>
            <div className='font-UI text-xl'>Username: {localUserData.username}</div>
            <div className='font-UI text-xl'>Email: {localUserData.email}</div>
            <div className='font-UI text-xl'>Password: {localUserData.password}</div>
          </div>
        </div>
        <div className='flex flex-col w-1/3'>
          <h1 className='font-UI text-3xl mr-20'>Preferences:</h1>
          <div className='grid-cols-1 space-y-4 mt-10'>
            <div className='font-UI text-xl'>Username: {localUserData.username}</div>
            <div className='font-UI text-xl'>Email: {localUserData.email}</div>
            <div className='font-UI text-xl'>Password: {localUserData.password}</div>
          </div>
        </div>
      </div>
    
    
    </>
  };
  
  export default UserPage;
